import React from "react";
import Profile from '../../assets/profile.png'
export default function profile() {
  return (
    
      <div className="item">
        <img
          className="ui mini circular image"
          src={Profile}
        />
        <div className="content">
          <div className="ui sub header">Elyse</div>
          Developer
        </div>
      </div>
    
  );
}
